export class Avatar {
    public image:string [] = [
        "",
        "",
        "",
        "",
        "",
        ""
    ];

    public getAvatar(){
        const im =this.image[this.aleatorio()];
        return (im);
    }

    aleatorio() {
        const al = Math.round(Math.random()*((this.image.length-1)-0)+ 0);
        return al;
    }

}